const styles = {
  header: {
    width: "100%",
    display: "flex",
    alignItems: "center",
    height: 550,
    padding: 20,
    marginLeft: 100,
  },

  containerImage: {
    width: "50%",
  },

  containerButtons: {
    width: "100%",
    height: 200,
    display: "flex",
    justifyContent: "center",
  },

  imageLeftSide: {
    width: 30,
    height: 30,
    margin: 5,
    rotate: "180deg",
  },

  imageRightSide: {
    width: 30,
    height: 30,
    margin: 5,
  },
  
  button: {
    border: "none",
    height: 50,
    width: 50,
    alignItems: "center",
    display: "flex",
    backgroundColor: "transparent",
  },
  separator: {
    height: 3,
    width: "50%",
    backgroundColor: "yellow",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  }
};

export default styles;
